  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);

  return (
    <div id="works" className="Parallax" style="marg">
      <h2 data-aos="fade-up" className="heading">
        Works
      </h2>
      <Firstjob />
      <Secondjob />
      <Thirdjob />
    </div>
  );
}

export default Works;
